const Avatar = styled.img`
  border-radius: 100%;
  height: 100px;
  margin: auto;
  margin-left: 30px;
  width: 100px;
`;
const Details = styled(Card)`
  width: 100%;
  display: grid;
  grid-template-columns: 1fr auto 1fr;
`;

function EditProfile() {
  return (
    <Container>
      <Details>
        <Avatar src="#" />
        <ProfileDetails />
      </Details>
      <Card className="my-3">
        <AboutMe />
      </Card>
      <Card>

      </Card>
    </Container>
  );
}

export default EditProfile;
